import React from "react";
import Box from "./Box";

function Room(props) {
 return (
   <div className="room">
    <h2>room{props.roomId}</h2>
     <Box 
        img = "./public/img/temp.png"
        name = "temp"
        data = {props.temp}
     />
     <Box 
        img = ".public/img/water-drop.png"
        name = "hub"
        data = {props.hub}
     />
   </div> );}
export default Room;
